import React from 'react';
import color from './backRespaldo.png'
import Auxiliary from './../../../../../hoc/Auxiliary';

const ColorDeFondo = () => {
    return (
        <Auxiliary>
            <defs>
                <pattern id="img1" patternUnits="userSpaceOnUse" width="100" height="100">
                    <image href={color} x="0" y="0" width="100" height="100" />
                </pattern>
            </defs>
        </Auxiliary>
    )
}

export default ColorDeFondo;
